import React from 'react';
import './About.css';

const About = () => {
  return (
    <section className="about-section animate-fadein">
      <h2>O nama</h2>
      <p>
        Backstage Caffe je mesto gde muzika i kafa spajaju dušu grada. Naša misija je da pružimo
        jedinstveni doživljaj retro ambijenta, sa pažljivo biranim koncertima i vrhunskom kafom.
      </p>
      <p>
        Tim entuzijasta koji stoji iza Backstagea svakodnevno radi na tome da se osećate kao kod kuće.
      </p>
    </section>
  );
};

export default About;
